    private static int test(String s) {
        String[] tokens = s.split(" ");
        List<Integer> numbers = new ArrayList<>();
        for (String token : tokens) {
            int i = Integer.parseInt(token);
            numbers.add(i);
        }

        List<Node> nodes = new ArrayList<>();
        int i = 0;
        while (i < numbers.size()) {
            Result result = readNode(numbers, i, nodes);
            i = result.i;
        }

        int sum = 0;
        for (Node node : nodes) {
            for (Integer metadataItem : node.metadata) {
                sum += metadataItem;
            }
        }
        return sum;
    }

    private static Result readNode(List<Integer> numbers, int i, List<Node> nodes) {
        int childrenCount = numbers.get(i++);
        int metadataCount = numbers.get(i++);
        List<Node> children = new ArrayList<>();
        for (int j = 0; j < childrenCount; ++j) {
            Result result = readNode(numbers, i, nodes);
            i = result.i;
            children.add(result.node);
        }
        List<Integer> metadata = new ArrayList<>();
        for (int k = 0; k < metadataCount; ++k) {
            metadata.add(numbers.get(i++));
        }
        Node node = new Node();
        node.childrenCount = childrenCount;
        node.metadataCount = metadataCount;
        node.children = children;
        node.metadata = metadata;
        Result result = new Result();
        result.i = i;
        result.node = node;
        nodes.add(node);
        return result;
    }

    private static class Result {
        int i;
        Node node;
    }

    private static class Node {
        int childrenCount;
        int metadataCount;
        List<Node> children = new ArrayList<>();
        List<Integer> metadata = new ArrayList<>();
    }
